import express from "express";
import dotenv from "dotenv";
import cors from "cors";
import bodyParser from "body-parser";
import morgan from "morgan";
import cloadinary from "cloudinary";
import fileupload from "express-fileupload";
import routes from "./routers";

dotenv.config();
const app = express();
const PORT = process.env.PORT || 4000;

cloadinary.config({
  cloud_name: process.env.CLOUDINARY_CLOUD_NAME,
  api_key: process.env.CLOUDINARY_API_KEY,
  api_secret: process.env.CLOUDINARY_API_SECRET,
  secure: true,
});

app.use(fileupload({ useTempFiles: true }));
app.use(express.json());
app.use(bodyParser.urlencoded({ extended: false }));
app.use(morgan("tiny"));
app.use(cors());
app.use(routes);

app.listen(PORT, console.log(`Server Listening on ${PORT}`));

export default app;

import express from "express";
import movieRouters from "./movie.route";
import categoryRouters from "./category.route";

const routes = express();

routes.get("/", (req, res) => {
  res.status(200).json({
    message: "This My Top Movies App backend",
  });
});

routes.use("/api/v1/movies", movieRouters);
routes.use("/api/v1/categories", categoryRouters);

routes.get("*", (req, res) => {
  res.status(404).json({
    message: "Page not found, try again",
  });
});

export default routes;

import movieController from "../controllers/movie.controllers";
import express from "express";
import { movieValidation } from "../validations/movie.validations";
import {
  checkIfMoveExistByName,
  checkUploadImage,
  checkImageFormat,
  checkIfMoveExistById,
  checkIfCategoryExist,
} from "../middleware/movie.middleware";

const router = express.Router();
router
  .route("/")
  .get(movieController.getMovies)
  .post(
    movieValidation,
    checkIfMoveExistByName,
    checkIfCategoryExist,
    checkUploadImage,
    checkImageFormat("jpg", "png"),
    movieController.createMovie
  );

router
  .route("/:id")
  .get(checkIfMoveExistById, movieController.getMovie)
  .patch(checkIfMoveExistById, movieController.updatingMovieController)
  .delete(checkIfMoveExistById, movieController.deltingMovieController);

export default router;

import {
  getAllMovies,
  searchMoviesByRating,
  addMovie,
  updateMovie,
  deleteMovie,
} from "../services/movie.services";
import { getMovieCategories } from "../services/movie.services";

export class movieControllers {
  async getMovies(req, res) {
    try {
      let movies;
      const { rate } = req.query;
      if (rate) {
        movies = await searchMoviesByRating(rate);
      } else {
        movies = await getAllMovies();
      }
      return res.status(200).json({
        movies,
      });
    } catch (error) {
      return res.status(500).json({
        message: "Error while getting movies",
        error: error.message,
      });
    }
  }

  async createMovie(req, res) {
    const results = req.results;
    try {
      const category_id =
        req.body.category_id.length > 1
          ? req.body.category_id
          : [req.body.category_id];
      const data = {
        ...req.body,
        category_id: category_id,
        image: results.secure_url,
      };
      const newMovie = await addMovie(data);
      return res.status(201).json({
        newMovie,
      });
    } catch (err) {
      res.status(500).json({
        message: "Unable to add new movie",
        error: err.message,
      });
    }
  }

  async getMovie(req, res) {
    try {
      const movie = req.movie;
      const categories = await getMovieCategories(movie.category_id);
      if (!movie) {
        return res.status(404).json({
          message: "Movie does not found",
        });
      }
      res.status(200).json({
        movie,
        categories,
      });
    } catch (error) {
      return res.status(500).json({
        message: "Error while getting movies",
        error: error.message,
      });
    }
  }

  async updatingMovieController(req, res) {
    const movie = req.movie;
    try {
      await updateMovie({ ...req.body }, movie.id);
      return res.status(200).json({
        movie: movie.id,
        ...req.body,
      });
    } catch (error) {
      return res.status(500).json({
        message: "Error while updating movie",
        error: error.message,
      });
    }
  }

  async deltingMovieController(req, res) {
    const movie = req.movie;
    try {
      await deleteMovie(movie.id);
      return res.status(200).json({
        message: "Movie has been deleted",
      });
    } catch (error) {
      return res.status(500).json({
        message: "Error while deleting movie",
        error: error.message,
      });
    }
  }
}

const movieController = new movieControllers();
export default movieController;

import { Movie, Category } from "../database/models";
import { Op } from "sequelize";

export const addMovie = async (movie) => {
  return await Movie.create(movie);
};

export const getAllMovies = async () => {
  const movies = await Movie.findAndCountAll({
    order: [["rating", "DESC"]],
  });
  return movies;
};

export const searchMoviesByRating = async (rate) => {
  const movies = await Movie.findAndCountAll({
    where: {
      rating: {
        [Op.and]: {
          [Op.lt]: 100,
          [Op.gte]: rate,
        },
      },
    },
    order: [["rating", "DESC"]],
  });
  return movies;
};

export const getMovieById = async (id) => {
  const movie = await Movie.findOne({
    where: {
      id,
    },
  });
  return movie;
};

export const updateMovie = async (updated, id) => {
  const movie = await Movie.update(updated, {
    where: {
      id,
    },
  });
  return movie;
};

export const deleteMovie = async (id) => {
  const movie = await Movie.destroy({
    where: {
      id,
    },
  });
  return movie;
};

export const getMovieCategories = async (id) => {
  return await Category.findAll({
    where: {
      id: id,
    },
  });
};

