module.exports = (sequelize, DataTypes) => {
  const Category = sequelize.define(
    "Category",
    {
      name: DataTypes.STRING,
    },
    {}
  );
  Category.associate = function (models) {
    Category.hasMany(models.Movie, {
      foreignKey: "category_id",
      as: "category",
      onDelete: "CASCADE",
    });
  };
  return Category;
};

module.exports = (sequelize, DataTypes) => {
  const Movie = sequelize.define(
    "Movie",
    {
    name: DataTypes.STRING,
    image: DataTypes.STRING,
    description: DataTypes.STRING,
    category_id: DataTypes.ARRAY(DataTypes.INTEGER),
    duration: DataTypes.INTEGER,
    rating: DataTypes.INTEGER
  },
  {}
  );
  Movie.associate = function(models){
    Movie.belongsTo(models.Category,{
      foreignKey:"category_id",
      as:"category",
      onDelete:"CASCADE"
    });
  }
  return Movie;
};

import joi from 'joi'
export const movieValidation=async(req,res,next)=>{
    const movieSchema=joi.object({
        name:joi.string().required(),
        description:joi.string().required(),
        duration:joi.number().required(),
        rating:joi.number().required(),
        category_id:joi.required().required(),
    }).options({allowUnknown:true});
    const value=await movieSchema.validate(req.body);
    if(value.error){
        res.status(400).json({
            message:value.error.details[0].message.replace(/["'`]+/g, ""),
        });
    }else{
        next()
    }
}

import { Movie, Category } from "../database/models";
import cloadinary from "cloudinary";

export const checkIfMoveExistByName = async (req, res, next) => {
  const name = req.body.name.toLowerCase();
  const movie = await Movie.findOne({
    where: {
      name,
    },
  });
  if (movie) {
    return res.status(409).json({
      message: "Movie already exist",
    });
  }
  next();
};

export const checkIfMoveExistById = async (req, res, next) => {
  const { id } = req.params;
  const movie = await Movie.findOne({
    where: {
      id,
    },
  });
  if (!movie) {
    return res.status(404).json({
      message: "Movie doesn't exist,please contact admin for support",
    });
  }
  req.movie = movie;
  next();
};

export const checkUploadImage = async (req, res, next) => {
  if (!req.files) {
    return res.status(400).json({
      message: "Please upload movie image",
    });
  }
  const file = req.files.image;
  cloadinary.uploader.upload(file.tempFilePath, async (results, err) => {
    if (err) {
      res.status(500).json({
        message: "Unable to upload image",
        error: err,
      });
    }
    req.results = results;
    next();
  });
};

export const checkImageFormat = (...extensions) => {
  return (req, res, next) => {
    const results = req.results;
    if (!extensions.includes(results.format)) {
      return res.status(405).json({
        message: `Only ${extensions} format are allowed`,
      });
    }
    req.results = results;
    next();
  };
};

export const checkIfCategoryExist = async (req, res, next) => {
  const { category_id } = req.body;
  const categories = await Category.findAll({
    where: {
      id: category_id,
    },
  });
  if (!categories || category_id.length != categories.length) {
    let categories_input = [];
    let categories_res = [];
    for (let i = 0; i < category_id.length; i++) {
      categories_input.push(parseInt(category_id[i]));
    }
    for (let j = 0; j < categories.length; j++) {
      categories_res.push(categories[j].id);
    }
    const filteredId = categories_input.filter(
      (item) => categories_res.indexOf(item) < 0
    );
    return res.status(404).json({
      message: `Category with ID ${filteredId} doesn't exist, please contact admin for support`,
    });
  }
  req.categories = categories;
  next();
};

import express from "express";
import categoryController from "../controllers/category.controller";

const router = express.Router();

router.route("/").get(categoryController.getCategories);

export default router;

import {
  getAllCategories,
  searchCategories,
} from "../services/category.service";

export class categoryControllers {
  async getCategories(req, res) {
    try {
      let categories;
      const { q } = req.query;
      if (q) {
        categories = await searchCategories(q.toLowerCase());
      } else {
        categories = await getAllCategories();
      }
      return res.status(200).json({
        categories,
      });
    } catch (error) {
      return res.status(500).json({
        message: "Error while getting categories",
        error: error.message,
      });
    }
  }
}

const categoryController = new categoryControllers();
export default categoryController;

import {Category} from '../database/models'

export const getAllCategories = async (limit, offset) => {
    const categories = await Category.findAndCountAll({
      limit,
      offset,
      order: [["createdAt", "DESC"]],
    });
    return categories;
  };
